//import Card from "./Card.js";

function App(){
    const User = require('./Card.js');
    var firstCard = new Card("front", "back");

    const test = document.createElement("label");

    firstCard.setFront("new");

    var sCard = new Card("high", "there");
    sCard.setFront("bing");

    test.innerHTML = firstCard.getFront() + sCard.getFront();

    document.body.appendChild(test);
}

class Card {

    constructor(front, back) {
        this.front = front;
        this.back = back;
        this.star = false;
    }

    getFront(){
        return this.front;
    }

    getBack(){
        return this.back;
    }

    setFront(front){
        this.front = front;
    }

    setBack(back){
        this.back = back;
    }

